import React,{Component} from 'react';
import { View, Text, SafeAreaView } from 'react-native';
import AsyncStorage from '@react-native-community/async-storage';
import Parent from './loginscreen';
// const HomeScreen = () => {
    
//     return (
//         <SafeAreaView style={{ flex: 1 }}>
            
//         </SafeAreaView>
//     );
// };

getData = async () => {
    try {
      let users = await AsyncStorage.getItem('user_id');
      console.log(users);
    } catch(e) {
      // error reading value
      console.log(e);
    }
  }
  
export function HomeScreen() {
        return (
        <View>
            <Text>test</Text>
            <Text onPress={this.getData}></Text>
        </View>
    )
    
}
export default HomeScreen;
